<script>
	export default {
		data() {
			return {
				InputBottom: 0,
				StatusBar: this.StatusBar,
				CustomBar: this.CustomBar,
				list: [],
				titleList: [{
						name: '学校设施'
					},
					{
						name: '学校规模'
					},
					{
						name: '学校荣誉'
					},
					{
						name: '电气类'
					},
					{
						name: '金融类'
					},
					{
						name: '艺术类'
					},
					{
						name: '医学类'
					}
				],
				tabCur: 0,
				mainCur: 0,
				verticalNavTop: 0,
				load: true
			};
		},
		components: {},
		onLoad() {
			uni.showLoading({
				title: '加载中...',
				mask: true
			});
			let list = [{
					name: '学校设施',
					tags1: '书桌',
					tags2: '电脑',
					tags3: '设施1',
					id: 1
				},
				{
					name: '学校规模',
					tags1: '1000-2000人',
					tags2: '2000-3000人',
					tags3: '4000-5000人',
					tags4: '5000-6000人',
					id: 2
				},
				{
					name: '学校荣誉',
					tags1: '先进集体',
					tags2: '先进单位',
					tags3: '先进党支部',
					id: 3
				},
				{
					name: '电气类',
					tags1: '电气信息工程',
					tags2: '生物医学',
					tags3: '电气类1',
					id: 4
				},
				{
					name: '金融类',
					tags1: '金融类1',
					tags2: '金融类2',
					tags3: '金融类3',
					id: 5
				},
				{
					name: '艺术类',
					tags1: '艺术类1',
					tags2: '艺术类2',
					tags3: '艺术类3',
					id: 6
				},
				{
					name: '医学类',
					tags1: '医学类1',
					tags2: '医学类2',
					tags3: '医学类3',
					id: 7
				}
			];
			for (let i = 0; i < 7; i++) {
				list[i] = {};
				list[i].name = String.fromCharCode(65 + i);
				list[i].id = i;
			}
			this.list = list;
			this.listCur = list[0];
		},
		onReady() {
			uni.hideLoading()
		},
		mounted() {
			console.log('当前的值:', this.StatusBar);
		},
		components: {

		},
		computed: {

		},
		methods: {
			InputFocus(e) {
				this.InputBottom = e.detail.height
			},
			InputBlur(e) {
				this.InputBottom = 0
			},
			TabSelect(e) {
				this.tabCur = e.currentTarget.dataset.id;
				this.mainCur = e.currentTarget.dataset.id;
				this.verticalNavTop = (e.currentTarget.dataset.id - 1) * 50
			},
			VerticalMain(e) {
				// #ifdef MP-ALIPAY
				return false //支付宝小程序暂时不支持双向联动 
				// #endif
				let that = this;
				let tabHeight = 0;
				if (this.load) {
					for (let i = 0; i < this.list.length; i++) {
						let view = uni.createSelectorQuery().select("#main-" + this.list[i].id);
						view.fields({
							size: true
						}, data => {
							this.list[i].top = tabHeight;
							console.log('当前的值:', data.height)
							tabHeight = tabHeight + data.height;
							this.list[i].bottom = tabHeight;
						}).exec();
					}
					this.load = false
				}
				let scrollTop = e.detail.scrollTop + 10;
				for (let i = 0; i < this.list.length; i++) {
					if (scrollTop > this.list[i].top && scrollTop < this.list[i].bottom) {
						this.verticalNavTop = (this.list[i].id - 1) * 50
						this.tabCur = this.list[i].id
						console.log(scrollTop)
						return false
					}
				}
			}
		}
	}
</script>

